----------------------------------------------- WIPDIRS -----------------------------------------------

CREATE TABLE WIPDIRS
(
    "COMPANY_CODE"     VARCHAR2(3 BYTE)  NOT NULL ENABLE,
    "PLANT_NO"         NUMBER(3, 0)      NOT NULL ENABLE,
    "ORDER_NO"         VARCHAR2(15 BYTE) NOT NULL ENABLE,
    "ITEM_NO"          VARCHAR2(15 BYTE) NOT NULL ENABLE,
    "AW_OPENING"       NUMBER(14, 2),
    "CT_OPENING"       NUMBER(14, 2),
    "IM_OPENING"       NUMBER(14, 2),
    "DM_OPENING"       NUMBER(14, 2),
    "OUT_QTY_OPENING"  NUMBER(16, 4),
    "IN_QTY_OPENING"   NUMBER(16, 4),
    "BAL_QTY"          NUMBER(16, 4),
    "OPEN_CLOSE"       VARCHAR2(1 BYTE),
    "CLOSE_DATE"       DATE,
    "LAST_OI_NO"       VARCHAR2(15 BYTE),
    "LAST_OI_DATE"     DATE,
    "LAST_REF_NO"      VARCHAR2(15 BYTE),
    "LAST_REF_DATE"    DATE,
    "TYPE"             VARCHAR2(10 BYTE),
    "SUB_TYPE"         VARCHAR2(10 BYTE),
    "PRODUCT_GROUP"    VARCHAR2(10 BYTE),
    "START_DATE"       DATE,
    "REMARKS"          VARCHAR2(240 BYTE),
    "OPT_STATUS"       VARCHAR2(1 BYTE),
    "OPT_DESC"         VARCHAR2(500 BYTE),
    "DISCOUNT_OPENING" NUMBER(14, 2)
);

CREATE UNIQUE INDEX WIPDIRS_PK ON WIPDIRS ("COMPANY_CODE", "PLANT_NO", "ORDER_NO", "ITEM_NO");

ALTER TABLE WIPDIRS
    ADD CONSTRAINT WIPDIRS_PK PRIMARY KEY ("COMPANY_CODE", "PLANT_NO", "ORDER_NO", "ITEM_NO")
        USING INDEX WIPDIRS_PK ENABLE;

COMMENT ON TABLE WIPDIRS IS 'Direct Sales';

